import React from 'react';
// import './App.css';

class App extends React.Component {
    constructor(){
        super();
        this.state={
            users: null
        }
    }
    componentDidMount(){
        fetch('https://reqres.in/api/users').then((resp)=> {
        resp.json().then((result)=>{
            console.warn(result.data)
            this.setState({users:result.data})
        })

        })
    }
}

export default App;
